import React from 'react';
import SearchBar from './thirdbar';
import Tweets from './tweets';

export default function Home() {
  return (

    <>
    <div className="container">

      <div className="row">
        .col-6
      </div>
    </div>
      <SearchBar />
      <Tweets />
    </>
  );
}
